import React from 'react';

const Header = () => {
    return (
        <header style={{ display: 'flex', alignItems: 'center', padding: '20px', backgroundColor: '#f5f5f5'}}>
            <circle style={{ width: '50px', height: '50px', backgroundColor: '#3354ba', backgroundClip: 'content-box', borderRadius: '50%', padding: '10px', display: 'inline-block', marginRight: '10px', display: 'flex', alignItems: 'center', color: '#f5f5f5', justifyContent: 'center', fontSize: '30px', font }}>P</circle>
            <h1>Pomo</h1>
        </header>
    );
};

export default Header;
